    private List<SimpleChainingMatch> showFits(final String full_sequence0, final String sought_sequence0) {
        SmithWaterman sw = new SmithWaterman(full_sequence0, sought_sequence0);
        List<SimpleChainingMatch> matches = sw.getMatches();
        for (Iterator<SimpleChainingMatch> iterator = matches.iterator(); iterator.hasNext(); ) {
            SimpleChainingMatch next =  iterator.next();
            System.out.println(sought_sequence0 + " sought " + next.score);
            System.out.println(next.showInTargets(full_sequence0, sought_sequence0));
        }
        return matches;
    }
